INSERT INTO `tbl_paslon` (`id_paslon`, `nomer_paslon`, `id_kandidat`, `visi`, `misi`, `points_vote`) VALUES
('e01e1aa4-f6fc-4759-8d2b-103d2e3d7535', 3, 'e01e1aa4-f6fc-4759-8d2b-103d2e3d7535', 'Menjadikan BEM FISIP UBHARA sebagai lembaga yang Profesional, Inovatif,dan Sinergis untuk FISIP SATU.', '1. Menjaga dan meningkatkan sinergitas kemitraan dan kerjasama bemfisip dgn stakeholder baik internal maupun eksternal dilingkungan ubhara \\n 2. Membangun sikap kritis dalam menanggapi isu secara mendalam dan komprehensif dengan mengoptimalkan partisipasimahasiswa FISIP \\n 3. Meningkatkan pelayanan mahasiswa yang aspiratif, representatif, integratif dan solutif untuk mendorong peningkatan kreatifitas dan prestasi', 116),
('f21522fd-9727-4e9b-97e6-cbb96d303399', 2, 'f21522fd-9727-4e9b-97e6-cbb96d303399', 'Menjadikan badan eksekutif mahasiswa (BEM) sebagai penggerak terhadap Mahasiswa yang berintegritas dan berkompetensi untuk regenerasi yang lebih berkualitas', '1. Melahirkan Mahasiswa yg berintelektual,memiliki keberanian dlm menghadapi perubahan \\n 2.Mewujudkan BEM dalam menampung aspirasi Mahasiswa \\n 3. Mewujudkan BEM sebagai organisator yang tanggap dan bertanggungjawab', 71),
('fc6fd6bf-1389-44cc-96d2-90c4e181bd7a', 1, 'fc6fd6bf-1389-44cc-96d2-90c4e181bd7a', 'Mewujudkan BEM FISIP sebagai organisasi yang bersinergitas, solidaritas, intelektual, dan terus berinovasi serta melayani mahasiswa sepenuh hati yang berkaitan dengan civitas akademika FISIP UBHARA', '1. Menjadikan BEM FISIP sebagai organisasi yang tanggap, bertanggung jawab dan bekerja secara nyata \\n 2. Menjadikan BEM FISIP sebagai wadah utama dalam menampung sekaligus menjalankan aspirasi mahasiswa  \\n 3. Menumbuhkan jiwa solidaritas dan toleransi kepada seluruh mahasiswa FISIP, agar memiliki rasa kesadaran terhadap isu isu yang terjadi', 113);
